import re

def find_view(url: str) -> str:
    """"""
    urlpatterns = [('^users$', 'index'), ('^users/(?P<id>\\d+)$', 'show'), ('^users/new$', 'new'), ('^users/create$', 'create'), ('^users/(?P<id>\\d+)/edit$', 'edit'), ('^users/(?P<id>\\d+)/delete$', 'delete'), ('^users/(?P<id>\\d+)/update$', 'update')]
    for pattern in urlpatterns:
        if re.match(pattern[0], url):
            return pattern[1]
    return 'Not Found'
